import 'device.dart';class Personel {  String id;  String name;  String subeId;  Device solBleklik;  Device sagBleklik;  Personel({    required this.id,    required this.name,    required this.subeId,    required this.solBleklik,    required this.sagBleklik,  });  factory Personel.fromJson(Map<String, dynamic> json) {    return Personel(      id: json['id'],      name: json['name'],      subeId: json['subeId'],      solBleklik: Device.fromJson(Map<String,dynamic>.from(json['solBleklik'] as Map)),      sagBleklik: Device.fromJson(Map<String,dynamic>.from(json['sagBleklik'] as Map)),    );  }  Map<String, dynamic> toJson() {    return {      'id': id,      'name': name,      'subeId': subeId,      'solBleklik': solBleklik.toJson(),      'sagBleklik': sagBleklik.toJson(),    };  }}